<html>
<body onload="showPage('00')">

<script>
 
 let audioContext ;
 let intervalId;
 let intCountMes = 0;
 let intCountBeat = 1;
 let intCountDiv = 4;
 let ArrayPart;
 let strPageID = "??";
 
 window.addEventListener('resize', AdjustSize);
  
 function showPage(pageId) {
 InitNewPage();
 strPageID = pageId;
 document.getElementById('IdPage_' + pageId ).classList.add('active');
 document.getElementById('HeadSongName').innerHTML = document.getElementById('InsSongNamePage_' + pageId).innerHTML;
 document.getElementById('HeadSongBpm').innerHTML = document.getElementById('InsSongBpmPage_' + pageId).innerHTML;
 document.getElementById('HeadSongStart').innerHTML = document.getElementById('InsSongSartPage_' + pageId).innerHTML;
 document.getElementById('HeadCounterArray').innerHTML = document.getElementById('InsCounterArrayPage_' + pageId).innerHTML;
 document.getElementById('bpm').value = parseInt(document.getElementById('InsSongBpmVALPage_' + pageId).innerHTML);
 
 
 AdjustSize();
}


function AdjustSize() {
  if (strPageID!="00" && strPageID != "??")
  {
  
  var WidthSize = parseFloat(document.getElementById('InsWidthPartPage_' + strPageID ).innerHTML) +
   4 * parseFloat(document.getElementById('InsNBPartPage_' + strPageID ).innerHTML) + 30 ;  
  var zoomCoeff = document.getElementById('IdPage_' + strPageID ).clientWidth / WidthSize;
  document.getElementById('DivSvgIdPage_' + strPageID ).style.zoom =  zoomCoeff;
  }
}


function InitNewPage() {
 const pages = document.querySelectorAll('.page');
 pages.forEach(page => {
 page.classList.remove('active');
 });
 
 const parts = document.querySelectorAll('.PartElement');
 parts.forEach(part => {
 part.classList.remove('active');
 });

 if (intervalId) 
 {
  clearInterval(intervalId);
  intervalId = null;
 }

   ArrayPart = null
   audioContext = null
   InitMet();

}
    
 
 function SetPartSelect(NbCurrentMes , BooAdd)
 {
  if (NbCurrentMes > 0 && NbCurrentMes < ArrayPart.length )
  {
   SetActiveView('Song_' + strPageID + '_Part_' + ArrayPart[NbCurrentMes -1] , BooAdd);
  }
 }
 
 function SetActiveView(strIDObj , BooAdd)
 {
  var ObjPart = document.getElementById(strIDObj);
  
  if (ObjPart != null)
  {
   if (BooAdd)
    ObjPart.classList.add('active');
   else
    ObjPart.classList.remove('active');
  }
 }

function playClick() {

  var note = audioContext.createOscillator();
  
  SetActiveView('Click_0' + String(intCountBeat) , false);
  if ( (intCountBeat % intCountDiv ) == 0)
  {
  
   SetPartSelect(intCountMes , false);
   intCountBeat = 1;
   intCountMes ++; 
   SetPartSelect(intCountMes , true);
   note.frequency.value = 380;
  }
  else
  {
   intCountBeat ++;
   note.frequency.value = 280;
  }
  
  SetActiveView('Click_0' + String(intCountBeat) , true);
 
  note.connect(audioContext.destination);

  note.start();
  note.stop(audioContext.currentTime + 0.05);
 
        }

function SetRun(pstrPageID , bpm , parrayPart)
 {
 
  InitMet();
  
  strPageID = pstrPageID;
 
  if (intervalId) 
  {
   clearInterval(intervalId);
   intervalId = null;
   document.getElementById('BtnRunMet').innerHTML = '&#9654;';
   SetActiveView('BtnRunMet' , false);
  }
  else
  {

 
 ArrayPart = parrayPart.split(';')
 audioContext = new (window.AudioContext || window.webkitAudioContext)();
 SetActiveView('BtnRunMet' , true) ;
 let interval = 60000 / bpm; // Convert BPM to milliseconds
 intervalId = setInterval(playClick, interval);
  }
 } 

 function InitMet()
 {
 const parts = document.querySelectorAll('.PartElement');
 parts.forEach(part => {
 part.classList.remove('active');
 });
 
   intCountMes = 0;
   intCountBeat = 1;
   intCountDiv = 4;
   intCountBeat = intCountDiv;
 }
 
 /* Set the width of the side navigation to 250px */
function openNav() {
 var sidenav = document.getElementById("mySidenav");
 if ( sidenav!=null ) 
 {
  sidenav.classList.add("active");
 }
}

/* Set the width of the side navigation to 0 */
function closeNav() {
 var sidenav = document.getElementById("mySidenav");
  sidenav.classList.remove("active");
}

 </script>

  align-items: center;
 }

 .page.active {
  display: block;
 }
 
 .PartElement {
        }
  
 .PartElement.active {
  stroke-width:8;
  stroke:red;
        }

</style>
